INSERT INTO `hoebro_proemail_content` (`content_id`, `type`, `from_name`, `from_email`, `to`, `subject`, `content`, `template`, `file`, `language_id`, `store`) VALUES
(741, 'affiliate.approve', '', '', '', '{store_name} - Your Affiliate Account has been activated!', '&lt;p&gt;Hi {firstname},&lt;/p&gt; &lt;p&gt;Welcome and thank you for registering at {store_name}!&lt;/p&gt; &lt;p&gt;Your affiliate account has now been created and you can log in by using your email address and password by visiting our website:&lt;/p&gt; &lt;p&gt;[button={affiliate_url}]My affiliate account[/button]&lt;/p&gt; &lt;p&gt;Upon logging in, you will be able to generate tracking codes, track commission payments and edit your account information.&lt;/p&gt; &lt;p&gt;Best regards,&lt;br&gt;{store_name} team&lt;/p&gt;', '', '', 1, 0),
(742, 'affiliate.forgotten', '', '', '', '{store_name} - New password', '&lt;p&gt;Dear customer,&lt;/p&gt; &lt;p&gt;Forgot your password ? No problem here is a brand new one for you:&lt;/p&gt; &lt;p&gt;Password: &lt;b&gt;{password}&lt;/b&gt;&lt;/p&gt; &lt;p&gt;[button={affiliate_url}]My affiliate account[/button]&lt;/p&gt; &lt;p&gt;Best regards,&lt;br/&gt;{store_name} team&lt;/p&gt;', '', '', 1, 0),
(743, 'affiliate.register', '', '', '', '{store_name} - Affiliate Program', '&lt;p&gt;Thank you for joining the {store_name} Affiliate Program!&lt;/p&gt;\r\n\r\n[if_approval]\r\n&lt;p&gt;Your account must be approved before you can login. Once approved you can log in by using your email address and password by visiting our website:&lt;/p&gt;\r\n[/if_approval]\r\n\r\n[if_not_approval]\r\n&lt;p&gt;Your account has now been created and you can log in by using your email address and password by visiting our website:&lt;/p&gt;\r\n[/if_not_approval]\r\n\r\n&lt;p&gt;[button={affiliate_url}]My affiliate account[/button]&lt;/p&gt; &lt;p&gt;Upon logging in, you will be able to generate tracking codes, track commission payments and edit your account information.&lt;/p&gt; &lt;p&gt;Best regards,&lt;br/&gt;{store_name} team&lt;/p&gt;', '', '', 1, 0),
(744, 'affiliate.transaction', '', '', '', '{store_name} - Affiliate Commission', '&lt;p&gt;Hi {firstname},&lt;/p&gt; &lt;p&gt;You have received {amount} commission!&lt;/p&gt; &lt;p&gt;Your total amount of commission is now {total}.&lt;/p&gt; &lt;p&gt;[button={affiliate_url}]My affiliate account[/button]&lt;/p&gt; &lt;p&gt;Best regards,&lt;br/&gt;{store_name} team&lt;/p&gt;', '', '', 1, 0),
(745, 'customer.approve', '', '', '', '{store_name} - Your Account has been activated!', '&lt;p&gt;Hi {firstname},&lt;/p&gt; &lt;p&gt;Welcome and thank you for registering at {store_name}!&lt;/p&gt; &lt;p&gt;Your account has now been created and you can log in by using your email address and password by visiting our website or at the following URL:&lt;/p&gt; &lt;p&gt;[button={account_url}]My account[/button]&lt;/p&gt; &lt;p&gt;Upon logging in, you will be able to access other services including reviewing past orders, printing invoices and editing your account information.&lt;/p&gt; &lt;p&gt;Best regards,&lt;br/&gt;{store_name} team&lt;/p&gt;', '', '', 1, 0),
(746, 'customer.credit', '', '', '', '{store_name} - Account Credit', '&lt;p&gt;Hi {firstname},&lt;/p&gt; &lt;p&gt;You have received {amount} credit!&lt;/p&gt; &lt;p&gt;Your total amount of credit is now {total}.&lt;/p&gt; &lt;p&gt;Your account credit will be automatically deducted from your next purchase.&lt;/p&gt; &lt;p&gt;[button={account_url}]My account[/button]&lt;/p&gt; &lt;p&gt;Best regards,&lt;br/&gt;{store_name} team&lt;/p&gt;', '', '', 1, 0),
(747, 'customer.forgotten', '', '', '', '{store_name} - New Password', '&lt;p&gt;Dear customer,&lt;/p&gt; &lt;p&gt;A new password was requested for {store_name} customer account.&lt;/p&gt; &lt;p&gt;To reset your password click on the button below:&lt;/p&gt; &lt;p&gt;[button={reset_link}]Reset my password[/button]&lt;/p&gt; &lt;p&gt;The IP used to make this request was: {ip}&lt;/p&gt; &lt;p&gt;Best regards,&lt;br/&gt;{store_name} team&lt;/p&gt;', '', '', 1, 0),
(748, 'customer.register', '', '', '', '{store_name} - Thank you for registering', '&lt;p&gt;Welcome and thank you for registering at {store_name}!&lt;/p&gt;\r\n\r\n[if_approval]\r\n&lt;p&gt;Your account must be approved before you can login. Once approved you can log in by using your email address and password by visiting our website:&lt;/p&gt;\r\n[/if_approval]\r\n\r\n[if_not_approval]\r\n&lt;p&gt;Your account has now been created and you can log in by using your email address and password by visiting our website:&lt;/p&gt;\r\n[/if_not_approval]\r\n\r\n&lt;p&gt;[button={account_url}]My account[/button]&lt;/p&gt; &lt;p&gt;Upon logging in, you will be able to access other services including reviewing past orders, printing invoices and editing your account information.&lt;/p&gt; &lt;p&gt;Best regards,&lt;br/&gt;{store_name} team&lt;/p&gt;', '', '', 1, 0),
(749, 'customer.reward', '', '', '', '{store_name} - Reward Points', '&lt;p&gt;Hi {firstname},&lt;/p&gt; &lt;p&gt;You have received {amount} Reward Points!&lt;/p&gt; &lt;p&gt;Your total number of reward points is now {total}.&lt;/p&gt; &lt;p&gt;[button={account_url}]My account[/button]&lt;/p&gt; &lt;p&gt;Best regards,&lt;br/&gt;{store_name} team&lt;/p&gt;', '', '', 1, 0),
(750, 'customer.voucher', '', '', '', 'You have been sent a gift card from {from}', '[if_image]&lt;p&gt;{image}&lt;/p&gt;[/if_image]\r\n\r\n&lt;p&gt;Congratulations, You have received a Gift Card worth &lt;b&gt;{amount}&lt;/b&gt;&lt;/p&gt; &lt;p&gt;This Gift Card has been sent to you by &lt;b&gt;{from}&lt;/b&gt;&lt;/p&gt;\r\n\r\n[if_message]&lt;p&gt;With a message saying:&lt;br&gt;{message}&lt;/p&gt;[/if_message]\r\n\r\n&lt;p&gt;&lt;b&gt;Redemption code:&lt;/b&gt; &lt;b&gt;{code}&lt;/b&gt;&lt;/p&gt; &lt;p&gt;To redeem this Gift Card, write down the redemption code then click on the the link below and purchase the product you wish to use this gift voucher on. You can enter the gift voucher code on the shopping cart page before you click checkout.&lt;/p&gt; &lt;p&gt;[button={store_url}]{store_name}[/button]&lt;/p&gt; &lt;p&gt;Best regards,&lt;br&gt;{store_name} team&lt;/p&gt;', '', '', 1, 0),
(751, 'enquiry.confirm', '', '', '', '{store_name} - Enquiry {enquiry_order_id}', '&lt;p&gt;&lt;strong&gt;Hi {firstname},&lt;/strong&gt;&lt;/p&gt; &lt;p&gt;Thank you for your interest in {store_name} products. Your enquiry has been received.&lt;/p&gt;&lt;p&gt;We will get back to you shortly.&lt;/p&gt;\r\n\r\n[if_customer]\r\n  &lt;p&gt;To view your enquiry click on the link below:&lt;/p&gt; &lt;p&gt;[button={enquiry_order_url}]My Enquiry[/button]&lt;/p&gt;\r\n[/if_customer]\r\n\r\n[if_download]\r\n  &lt;p&gt;[text_download_link]&lt;/p&gt; &lt;p&gt;[button={download_url}]My downloads[/button]&lt;/p&gt;\r\n[/if_download]\r\n  \r\n&lt;p&gt;{invoice}&lt;/p&gt; &lt;p&gt;Best regards,&lt;br&gt;{store_name} team&lt;/p&gt;', '', '', 1, 0),
(752, 'order.confirm', '', '', '', '{store_name} - Order {order_id}', '&lt;p&gt;&lt;strong&gt;Hi {firstname},&lt;/strong&gt;&lt;/p&gt; &lt;p&gt;Thank you for your interest in {store_name} products. Your order has been received and will be processed once payment has been confirmed.&lt;/p&gt;\r\n\r\n[if_customer]\r\n  &lt;p&gt;To view your order click on the link below:&lt;/p&gt; &lt;p&gt;[button={order_url}]My order[/button]&lt;/p&gt;\r\n[/if_customer]\r\n\r\n[if_download]\r\n  &lt;p&gt;[text_download_link]&lt;/p&gt; &lt;p&gt;[button={download_url}]My downloads[/button]&lt;/p&gt;\r\n[/if_download]\r\n  \r\n&lt;p&gt;{invoice}&lt;/p&gt; &lt;p&gt;Best regards,&lt;br&gt;{store_name} team&lt;/p&gt;', '', '', 1, 0),
(753, 'order.return', '', '', '', '{store_name} - Return Update {return_id}', '&lt;p&gt;&lt;strong&gt;Dear customer,&lt;/strong&gt;&lt;/p&gt; &lt;p&gt;Your return &lt;b&gt;#{return_id}&lt;/b&gt; has been updated to the following status: &lt;b&gt;{order_status}&lt;/b&gt;&lt;/p&gt;\r\n\r\n[if_message]\r\n&lt;p&gt;The comments for your order are:&lt;/p&gt; &lt;p&gt;{message}&lt;/p&gt;\r\n[/if_message]\r\n\r\n&lt;p&gt;Best regards,&lt;br/&gt;{store_name} team&lt;/p&gt;', '', '', 1, 0),
