(3255, 0, 'faq_manager', 'faq_manager_sections', '[{\"title\":{\"1\":\"Online Catering System - Classroom Snack\"},\"groups\":[{\"question\":{\"1\":\"How far in advance do I have to place my order?\"},\"answer\":{\"1\":\"&lt;p&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;span style=&quot;line-height:normal&quot;&gt;&lt;span style=&quot;font-size:10.0pt&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;To place an order, we do require a minimum of &lt;strong&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;3 working days\\u2019 notice (72 hours)&lt;\\/span&gt;&lt;\\/strong&gt; prior to your event date through our website with full payment.&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"How do I place order for customised Cakes, Cupcakes or Cookies?\"},\"answer\":{\"1\":\"&lt;p style=&quot;margin-bottom:0in; text-align:justify&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;span style=&quot;line-height:normal&quot;&gt;&lt;span style=&quot;font-size:10.0pt&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;To place an order for customised cakes, cupcakes or cookies, we do require a minimum of &lt;strong&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;5 - 7 working days\\u2019 notice with minimum order of 20 pieces and above.\\u00a0 Due to copyright issue, Hoe Brother Catering reserve the right to reject any image at our own discretion.&lt;\\/span&gt;&lt;\\/strong&gt;&lt;strong&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;fo