\"1\":\"What is the delivery fee?\"},\"answer\":{\"1\":\"&lt;p&gt;An SGD 10 delivery fee per order will be imposed for order falls below SGD 15&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"What is the cancellation policy?\"},\"answer\":{\"1\":\"&lt;p style=&quot;margin-bottom:0in; text-align:justify&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;span style=&quot;line-height:normal&quot;&gt;&lt;span style=&quot;font-size:10.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;In the event of a cancellation is needed, please contact us by phone at (65) 6363 6449 or email &lt;\\/span&gt;&lt;\\/span&gt;&lt;a href=&quot;mailto:sales@hoebrothers.com.sg&quot;&gt;&lt;span style=&quot;font-size:10.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;sales@hoebrothers.com.sg&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/a&gt;&lt;span style=&quot;font-size:10.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt; at least &lt;b&gt;1 working day before 12.00 noon&lt;\\/b&gt; prior to the scheduled collection\\/ delivery date without any cancellation fee.&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"How do I amend my order?\"},\"answer\":{\"1\":\"&lt;p style=&quot;margin-bottom:0in; text-align:justify&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;span style=&quot;line-height:normal&quot;&gt;&lt;span style=&quot;font-size:10.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;For any amendment, you may email us at &lt;\\/span&gt;&lt;\\/span&gt;&lt;a href=&quot;mailto:sales@hoebrothers.com.sg&quot;&gt;&lt;span style=&quot;font-size:10.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;sales@hoebrothers.com.sg&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/a&gt;&lt;span style=&quot;font-size:10.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt; at least &lt;b&gt;1 working day before 12.00 noon&lt;\\/b&gt; prior to the scheduled collection\\/ delivery date.&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\"}},{\"question\":{\"1\":\"Allergen Information\"},\"answer\":{\"1\":\"&lt;p style=&quot;margin-bottom:0in; text-align:justify&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;span style=&quot;line-height:normal&quot;&gt;&lt;span style=&quot;font-size:10.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;Items marked with \\u2018Gluten, Egg, Dairy and Nuts are prepared in a NON-Allergy Free Kitchen. &lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-bottom:0in; text-align:justify&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;span style=&quot;line-height:normal&quot;&gt;&lt;span style=&quot;font-size:10.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-bottom:0in; text-align:justify&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;span style=&quot;line-height:normal&quot;&gt;&lt;span style=&quot;font-size:10.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;For Jello orders, kindly note that we are using fish gelatine.&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\"}}]},{\"title\":{\"1\":\"Orders for In-house meetings and Events(Staff)\"},\"groups\":[{\"question\":{\"1\":\"How do I order?\"},\"answer\":{\"1\":\"&lt;p style=&quot;margin-bottom:0in; text-align:justify&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&