(3265, 0, 'aboutus', 'aboutus_text_1', '&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot; style=&quot;margin:0in; text-align:center&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#cc0066&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0in; text-align:justify&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;Hoe Brothers Catering has catered to International schools in Singapore since 1966. Currently we are operating at the Singapore American School Cafeterias and German European School Singapore Cafeteria, providing meals to the High School, Middle School, Primary School and Grab n Go kiosks.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0in; text-align:justify&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0in; text-align:justify&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;Working closely with our dieticians, each day we serve and provide healthy and balanced meals to 4500 customers, adhering to the nutritional guidelines.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\r\n &lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0in; text-align:justify&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0in; text-align:justify&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0in; text-align:justify&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;Catering Services&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0in; text-align:justify&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;We also cater for private functions and corporate events. Our experience in the International schools exposes us to many cultures, cuisines and special needs, enabling us to cater for a diverse group of events and functions.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0in; text-align:justify&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0in; text-align:justify&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;Contact us at &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color:black&quot;&gt;&lt;a href=&quot;mailto:sales@hoebrothers.com.sg&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;sales@hoebrothers.com.sg&lt;/span&gt;&lt;/span&gt;&lt;/a&gt;&lt;/span&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt; for more information.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\r\n &lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0in; text-align:justify&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0in; text-align:justify&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0in; text-align:justify&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;Specialties&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0in; text-align:justify&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;Our catering specialties include Christmas dinners, Fish \'n\' Chips and a wide range of special BBQs. Homemade bakes and pastries&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\r\n &lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0in; text-align:justify&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0in; text-align:justify&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0in; text-align:justify&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;Mission&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0in; text-align:justify&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;We are proud to provide excellent service and flexibility,&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0in; text-align:justify&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;whilst maintaining ahigh standard of hygiene and quality.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin:0in; text-align:justify&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;text-justify:inter-ideograph&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:black&quot;&gt;Best quality hot fresh food, for every customer!&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot; style=&quot;margin:0in; text-align:center&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Century Gothic&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#cc0066&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;', 0),
